import React from 'react';
import { useLocation } from 'react-router-dom';

const UserDashboard = () => {
    const { state } = useLocation();
    const user = state?.user;

    return (
        <div style={pageStyle}>
            {user ? (
                <div style={gridStyle}>
                    <div style={itemStyle}><strong>Name:</strong> {user.name}</div>
                    <div style={itemStyle}><strong>Account Number:</strong> {user.account_number}</div>
                    <div style={itemStyle}><strong>IFSC Code:</strong> {user.ifsc_code}</div>
                    <div style={itemStyle}><strong>Location:</strong> {user.location}</div>
                </div>
            ) : (
                <p>No user data available.</p>
            )}
        </div>
    );
};

// Styles for the dashboard
const pageStyle = {
    backgroundColor: '#ffffff',
    fontFamily: 'Arial, sans-serif',
    padding: '20px',
    maxWidth: '600px',
    margin: '50px auto',
    borderRadius: '10px',
    boxShadow: '0px 4px 8px rgba(0, 0, 0, 0.1)',
};

const gridStyle = {
    display: 'grid',
    gridTemplateColumns: '1fr 1fr',
    gridTemplateRows: '1fr 1fr',
    gap: '20px',
    marginTop: '20px',
};

const itemStyle = {
    padding: '10px',
    border: '1px solid #ddd',
    borderRadius: '5px',
    backgroundColor: '#f9f9f9',
    textAlign: 'center',
};

export default UserDashboard;
